import React from "react";
import { useNavigate } from "react-router-dom";

function LogoutButton() {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("user");
    navigate("/login");
  };

  return (
    <button
      onClick={handleLogout}
      style={{
        background: "red",
        color: "white",
        padding: "10px 20px",
        border: "none",
        borderRadius: "5px",
        marginTop: "20px",
        cursor: "pointer",
      }}
    >
      Sign Out
    </button>
  );
}

export default LogoutButton;
